import React from "react";
import Drumpad from "./drumpad";

function Display(){
    return (
        <div id="display">
            <Drumpad id="Q"/>
            <Drumpad id="W"/>
            <Drumpad id="E"/>
            <Drumpad id="A"/>
            <Drumpad id="S"/>
            <Drumpad id="D"/>
            <Drumpad id="Z"/>
            <Drumpad id="X"/>
            <Drumpad id="C"/>
        </div>
    );
}

export default Display;
